import React from 'react'
import './MedSnow.css'

export default class MedSnow extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return(
      <div className="medSnowContainer">
        <canvas id="snowflakesMed"></canvas>
      </div>
    )
  }

}
